```solidity
pragma solidity 0.6.12;

contract YourContract {
    address[] public coins;
    address[] public underlying_coins;
    address public curve;
    address public token;
    uint256 private totalSupply;
    uint256 private locked;

    function withdraw_donated_dust() external payable {
        require(locked == 0, "Locked");
        locked = 1;

        if (msg.value == 0 && address(this) != curve) {
            (bool success,) = curve.delegatecall(abi.encodeWithSignature("function_name()"));
            require(success, "Call to curve failed");
        }

        if (msg.value == 0 && address(this) != curve && address(this) != token) {
            (bool success,) = token.delegatecall(abi.encodeWithSignature("balanceOf(address)", address(this)));
            require(success, "Call to token failed");
            if (success) {
                locked = 0;
            }
        }
    }

    function add_liquidity(uint256[4] memory amounts, uint256 min_mint_amount) external payable {
        require(locked == 0, "Locked");
        locked = 1;

        if (msg.value == 0 && amounts[0] > 0 && amounts[1] > 0 && amounts[2] > 0 && amounts[3] > 0 && address(this) != curve) {
            (bool success,) = curve.call(abi.encodeWithSignature("add_liquidity(uint256[4],uint256)", amounts, min_mint_amount));
            require(success, "Call to add_liquidity in curve failed");
        }

        if (msg.value == 0 && amounts[0] > 0 && amounts[1] > 0 && amounts[2] > 0 && amounts[3] > 0 && address(this) != curve && address(this) != token) {
            (bool success,) = token.delegatecall(abi.encodeWithSignature("balanceOf(address)", address(this)));
            require(success, "Call to token failed");
            if (success) {
                locked = 0;
            }
        }
    }

    function remove_liquidity(uint256 _amount, uint256[4] memory min_amounts) external payable {
        require(locked == 0, "Locked");
        locked = 1;

        if (msg.value == 0 && address(this) != token) {
            (bool success,) = token.call(abi.encodeWithSignature("transferFrom(address,address,uint256)", msg.sender, address(this), _amount));
            require(success, "Call to transferFrom in token failed");
        }

        if (msg.value == 0 && address(this) != token && address(this) != curve) {
            (bool success,) = curve.call(abi.encodeWithSignature("remove_liquidity(uint256,uint256[4])", _amount, min_amounts));
            require(success, "Call to remove_liquidity in curve failed");
            if (success) {
                locked = 0;
            }
        }
    }

    function remove_liquidity_imbalance(uint256[4] memory amounts, uint256 max_burn_amount) external payable {
        require(locked == 0, "Locked");
        locked = 1;

        if (msg.value == 0 && amounts[0] > 0 && amounts[1] > 0 && amounts[2] > 0 && amounts[3] > 0 && address(this) != token) {
            (bool success,) = token.delegatecall(abi.encodeWithSignature("balanceOf(address)", msg.sender));
            require(success, "Call to token failed");

            if (success && max_burn_amount > 0) {
                (success,) = token.call(abi.encodeWithSignature("transferFrom(address,address,uint256)", msg.sender, address(this), max_burn_amount));
                require(success, "Call to transferFrom in token failed");
                if (success) {
                    locked = 0;
                }
            }
        }
    }
}
```

Please note that the function names in the `delegatecall` and `call` methods are placeholders. You must replace them with the actual function names. Also, as the contract descriptions do not provide the function names for the `0x8da5cb5b` and `0x70a08231` methods, they are represented in the `delegatecall` methods as `"function_name()"`.
